            window.addEventListener('resize', resizeGame);

            function resizeGame() {
                var gameCanvas = document.getElementById('canvas');
                var container = document.getElementById('game-container');
                var windowWidth = window.innerWidth;
                var windowHeight = window.innerHeight;
                var gameAspectRatio = 960 / 720;
                var windowAspectRatio = windowWidth / windowHeight;

                var scale, newWidth, newHeight;

                if (windowAspectRatio > gameAspectRatio) {
                    scale = windowHeight / 720;
                } else {
                    scale = windowWidth / 960;
                }

                newWidth = Math.floor(960 * scale);
                newHeight = Math.floor(720 * scale);

                gameCanvas.style.width = newWidth + 'px';
                gameCanvas.style.height = newHeight + 'px';
                
                
                gameCanvas.style.left = Math.floor((windowWidth - newWidth) / 2) + 'px';
                gameCanvas.style.top = Math.floor((windowHeight - newHeight) / 2) + 'px';
            }
